//import { Link} from "react-router-dom";
//import Button from '../components/button';
//import ProductHero from '../components/productHero.js';

import Card from '../components/card';
import img1 from '../images/CABRIO_Elena.jpeg'
import img2 from '../images/Serena.jpg'
import img3 from '../images/vorakit.jpg'

import img4 from '../images/Yessine.jpg'







const ContactUs = () => {
    return (
        <div className="container-fluid d-flex justify-content-center">
        <div className="row">
            <div className="col-md-3">
            <Card imgsrc={img1} title="Elena Cabrio" link="https://www-sop.inria.fr/members/Elena.Cabrio/" nameButton="More" text="Côte d’Azur university, CNRS, Inria, I3S, France"/>
            
            </div>
            <div className="col-md-3">
    <Card imgsrc={img2} title="Serena Villata" link="https://www.i3s.unice.fr/~villata/index.html" nameButton="More" text="Côte d’Azur university, CNRS, Inria, I3S, France"/>
            </div>
            <div className="col-md-3">
    <Card imgsrc={img3} title="Vorakit Vorakitphan"   nameButton="More" link="https://sites.google.com/view/vorakitvorakitphan" />
            </div>
            <div className="col-md-3">
    <Card imgsrc={img4} title="Yessine Ben El Bey"   link="https://www.linkedin.com/in/yessinebenelbey/" nameButton="More" text="Côte d'Azur university" />
            </div>
        </div>
    </div>
    /*<>
    <div className="container2">
    <div  id="bg" style={{
     height:'700px'
              }}>
<div className="text">
        <h1>Propaganda</h1>
          </div>
    </div>
    </div>
    </>*/
    );
  };
  
  export default ContactUs;
